import React from 'react';

const SidePanel = () => {
  return (
    <header className="NavDropdown">
      <div className="NavDropdown-Component">
        <nav className="navigation-dropdown" id="navigation-dropdown">
          <div className="navigation-items">
            <ul>
              <li><a href="/html/">Communities</a> </li>
              <li><a href="/html/">Portals</a></li>
            </ul>
          </div>
        </nav>
      </div>
    </header>
  );
}

export default SidePanel;
